import React from 'react';
import { connect } from 'dva';
import {
  Dimensions,
  Keyboard,
  StyleSheet,
} from 'react-native';
import moment from 'moment';
import uuid from 'uuid';
import { createMaterialTopTabNavigator } from '@react-navigation/material-top-tabs';
import ExpensePage from './ExpensePage';
import IncomePage from './IncomePage';

const Tab = createMaterialTopTabNavigator();
class CreateTask extends React.PureComponent {
  state = {}

  // Local path to file on the device
  render() {
    const { route } = this.props;
    const { currentDate } = route.params;
    return (
      <Tab.Navigator>
        <Tab.Screen name="Expense" component={ExpensePage} currentDate={currentDate} />
        <Tab.Screen name="Income" component={IncomePage} currentDate={currentDate} />
      </Tab.Navigator>
    )
  }
}
export default connect(state => ({
  loading: state.loading,
  effects: state.loading.effects
}))(CreateTask);
